import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import HomePage from './HomePage';
import PlayersPage from './PlayersPage';

const App: React.FC = () => {
  return (
    <Router>
      <div style={{ fontFamily: 'Arial, sans-serif' }}>
        <nav style={{ 
          backgroundColor: '#2c5530', 
          padding: '1rem',
          marginBottom: '2rem'
        }}>
          <div style={{ 
            maxWidth: '1200px', 
            margin: '0 auto',
            display: 'flex',
            gap: '2rem'
          }}>
            <Link 
              to="/" 
              style={{ 
                color: 'white', 
                textDecoration: 'none',
                fontSize: '1.1rem',
                fontWeight: 'bold'
              }}
            >
              Home
            </Link>
            <Link 
              to="/players" 
              style={{ 
                color: 'white', 
                textDecoration: 'none',
                fontSize: '1.1rem',
                fontWeight: 'bold'
              }}
            >
              Players
            </Link>
          </div>
        </nav>

        <div style={{ maxWidth: '1200px', margin: '0 auto', padding: '0 1rem' }}>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/players" element={<PlayersPage />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
